async () => {

		if(vayIndIndiaKycPoiUpload.files.length === 1) {
			await JSObjectIndIndiaKYC.deleteIfFileExist('POI');	
		 	await QueryInsertIndIndia.run({ 
				docType:vayIndIndiaKycPoiSelection.selectedOptionValue, 
				docPathFilename :vayIndIndiaKycPoiUpload.files[0].name
			});
			QueryIndKycIndiaPOI.run();
		}

		if(vayIndIndiaKycPoaUpload.files.length === 1) {
			await JSObjectIndIndiaKYC.deleteIfFileExist('POA');	
			await QueryInsertIndIndia.run({
				docType:vayIndIndiaKycPoaSelection.selectedOptionValue,
				docPathFilename: vayIndIndiaKycPoaUpload.files[0].name
			});
			QueryIndKycIndiaPOA.run();
		}

		if(vayIndIndiaKycPhotoUpload.files.length === 1) {
			await JSObjectIndIndiaKYC.deleteIfFileExist('PHT');	
		 	await QueryInsertIndIndia.run({
				docType:'IndividualIndiaPhoto',
				docPathFilename : vayIndIndiaKycPhotoUpload.files[0].name
			});
			QueryIndKycIndiaPhoto.run();
		}
		showAlert('KYC Documents Uploaded');
		navigateTo('Individual KYC Summary', {});
	}

